Sunset Books are known for their great, clear illustrations, plans, and diagrams. This is another of their well-organized, extensively illustrated guides to the basics of home repair. Clearly written and indexed for easy reference, and covering a large range of home repair problems, inside and out, including trouble-shooting with appliances and outdoor equipment, this is a good, basic book for anyone who wants to save some money on home repairs by figuring out how to do-it-yourself. You, too, can become the little engine that could, and this book will get you started!
